import React from 'react'
import './Card.css';

const Card = (props) => {
  return (
    <div className='card'>
      {props.person.name}
      {props.person.birthday}
      {props.person.favoriteFoods.meats.map(element => <p>{element}</p>)}
      {props.person.favoriteFoods.fish.map(element => <p>{element}</p>)}
    </div>
  )
}

export default Card
